import React, { components } from "react";
class Home extends components {
  render() {
    return (
      <div>
        <h2> How to use SEPER</h2>
        <p>I am not sure what to put on the home page</p>
        <p>A nice logo? Instructions?</p>
      </div>
    );
  }
}
export default Home;
